import React, { useState } from 'react';

function App() {
  const [form, setForm] = useState({
    income: 5000,
    loan_amount: 150,
    credit_history: 1,
    age: 30,
    gender: 'Male',
    married: 'Yes',
    education: 'Graduate',
    self_employed: 'No',
    dependents: '0',
    property_area: 'Urban',
    loan_term: 360,
  });
  const [result, setResult] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;

    // fields jo number hone chahiye
    const numericFields = [
      'income',
      'loan_amount',
      'credit_history',
      'age',
      'loan_term',
    ];

    setForm((prev) => ({
      ...prev,
      [name]: numericFields.includes(name) ? parseFloat(value) || 0 : value,
    }));
  };

  const predict = async () => {
    try {
      const res = await fetch('http://localhost:8000/predict', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(form),
      });
      const data = await res.json();
      setResult(data);
    } catch (error) {
      console.error('Prediction error:', error);
    }
  };

  return (
    <div style={{ padding: 20, fontFamily: 'Arial' }}>
      <h2>Full-Stack Credit Risk — React Frontend</h2>
      <div style={{ display: 'flex', gap: 20 }}>
        <div style={{ flex: 1 }}>
          <label>
            Income:{' '}
            <input
              type="number"
              name="income"
              value={form.income}
              onChange={handleChange}
            />
          </label>
          <br />
          <label>
            Loan Amount:{' '}
            <input
              type="number"
              name="loan_amount"
              value={form.loan_amount}
              onChange={handleChange}
            />
          </label>
          <br />
          <label>
            Credit History:{' '}
            <select
              name="credit_history"
              value={form.credit_history}
              onChange={handleChange}
            >
              <option value={1}>1</option>
              <option value={0}>0</option>
            </select>
          </label>
          <br />
          <label>
            Age:{' '}
            <input
              type="number"
              name="age"
              value={form.age}
              onChange={handleChange}
            />
          </label>
          <br />
          <label>
            Gender:{' '}
            <select name="gender" value={form.gender} onChange={handleChange}>
              <option>Male</option>
              <option>Female</option>
            </select>
          </label>
          <br />
          <label>
            Married:{' '}
            <select name="married" value={form.married} onChange={handleChange}>
              <option>Yes</option>
              <option>No</option>
            </select>
          </label>
          <br />
          <label>
            Education:{' '}
            <select
              name="education"
              value={form.education}
              onChange={handleChange}
            >
              <option>Graduate</option>
              <option>Not Graduate</option>
            </select>
          </label>
        </div>

        <div style={{ flex: 1 }}>
          <label>
            Self Employed:{' '}
            <select
              name="self_employed"
              value={form.self_employed}
              onChange={handleChange}
            >
              <option>No</option>
              <option>Yes</option>
            </select>
          </label>
          <br />
          <label>
            Dependents:{' '}
            <select
              name="dependents"
              value={form.dependents}
              onChange={handleChange}
            >
              <option>0</option>
              <option>1</option>
              <option>2</option>
              <option>3+</option>
            </select>
          </label>
          <br />
          <label>
            Property Area:{' '}
            <select
              name="property_area"
              value={form.property_area}
              onChange={handleChange}
            >
              <option>Urban</option>
              <option>Semiurban</option>
              <option>Rural</option>
            </select>
          </label>
          <br />
          <label>
            Loan Term (months):{' '}
            <input
              type="number"
              name="loan_term"
              value={form.loan_term}
              onChange={handleChange}
            />
          </label>
          <br />
          <br />
          <button onClick={predict}>Predict</button>
        </div>
      </div>

      {result && (
        <div style={{ marginTop: 20 }}>
          <strong>Decision:</strong> {result.decision} —{' '}
          <strong>Risk Score:</strong> {result.risk_score.toFixed(3)}
        </div>
      )}
    </div>
  );
}

export default App;
